import React from 'react';
import profPic from '../assets/profPic.png';
import IconsList from './IconsList';

export default function Landing() {
   return (
      <div className='two-col-content my-2'>
         <div className='bio-info'>
            <div className='text-white'>
               <h2 className='my-name'>Welcome!</h2>
               <p>
                  I'm Field. I'm a web developer with a decade of experience building
                  front-ends and dashboards for use across a variety of sectors.
                  {/* I'm
                  passionate about intuitive experiences and operational efficiency.
                  Thanks for stopping by! */}
               </p>
               {/* <hr className='bio-hr' /> */}
            </div>
         </div>
         <div className='profile-picture'>
            <span className='circle-image'>
               <img alt='profPic' src={profPic} />
            </span>
         </div>
      </div>
   );
}
